import React, { useState } from "react";
import MyHeader from "./../components/MyHeader";
const Home = () => {
    const [curDate, setCurDate] = useState(new Date());
    return (
        <div>
            <MyHeader headText={`${curDate.getFullYear()}`} />
        </div>
    );
};

export default Home;
